import React from 'react';
import './App.css'

const App = () => {
  return (
    <>
    <div className='topnav'>
      <a className='active' href='#home'> home </a>
      <a href='#about'> About us </a>
      <a href='#services'> Services </a>
      <a href='#contacts'> Contacts </a>
    </div>
    </>
  )
}

export default App
